/**
 * Update paragraph text below question
 */
function updateParagraphText() {
    const paragraphText = document.querySelector('.relative.top-12 p');
    if (paragraphText) {
        paragraphText.innerHTML = 'Select only one:<br class="hidden sm:block">';
    }
}

/**
 * Update answer buttons for duration question
 */
function updateAnswerButtons() {
    const buttonGrid = document.querySelector('.relative.top-20 .grid');
    if (buttonGrid) {
        // Reset current selections
        const currentButtons = buttonGrid.querySelectorAll('button');
        currentButtons.forEach(button => {
            button.classList.remove('bg-teal', 'text-white');
        });
        
        // Update button text
        const newButtons = [
            'Today',
            'Yesterday',
            '2-3 days ago',
            '4 days up'
        ];
        
        // Update button text
        const buttons = buttonGrid.querySelectorAll('button');
        for (let i = 0; i < buttons.length; i++) {
            buttons[i].textContent = newButtons[i];
            
            // For second question, make buttons exclusive selection
            buttons[i].addEventListener('click', function() {
                // Remove selected state from all buttons
                buttons.forEach(btn => {
                    btn.classList.remove('bg-teal', 'text-white');
                });
                
                // Add selected state to clicked button
                this.classList.add('bg-teal', 'text-white');
            });
        }
    }
}

/**
 * Show loading animation and redirect to dashboard
 */
function showLoadingAnimation() {
    console.log('Showing loading animation after final question');
    
    // Get the final selection for the last question
    const selectedButtons = document.querySelectorAll('.relative.top-20 .grid button.bg-teal');
    const selectedOptions = Array.from(selectedButtons).map(btn => btn.textContent.trim());
    
    // Save the final selection
    userSelections[currentQuestionNumber - 1] = selectedOptions;
    
    // Log all user selections for the assessment
    console.log('All user selections:', userSelections);
    
    // Get the app content container
    const appContent = document.getElementById('app-content');
    const appWrapper = document.querySelector('.app-wrapper');
    
    if (appWrapper && appContent) {
        // Clear the app content while preserving the app-wrapper
        appContent.innerHTML = '';
        
        // Create loading dots animation - centered and larger with accessibility attributes
        const loadingElement = document.createElement('div');
        loadingElement.className = 'flex flex-col items-center justify-center h-screen';
        loadingElement.setAttribute('role', 'alert');
        loadingElement.setAttribute('aria-live', 'assertive');
        
        loadingElement.innerHTML = `
            <div class="flex space-x-6">
                <div class="w-8 h-8 bg-teal rounded-full animate-bounce" style="animation-delay: 0s"></div>
                <div class="w-8 h-8 bg-teal rounded-full animate-bounce" style="animation-delay: 0.2s"></div>
                <div class="w-8 h-8 bg-teal rounded-full animate-bounce" style="animation-delay: 0.4s"></div>
                <div class="w-8 h-8 bg-teal rounded-full animate-bounce" style="animation-delay: 0.6s"></div>
            </div>
        `;
        
        // Append the loading animation to app-content
        appContent.appendChild(loadingElement);
        
        // Loading animation will show for a few seconds before medicine recommendation appears
        console.log('Assessment completed, preparing to show medicine recommendation...');
    }
}
